import Link from 'next/link';
//import logo from './static/logo.jpg'

const Logo = () => (
  <div className="logo">
    <Link href="/">
      <a>
        <img src="/static/logo.jpg" />
      </a>
    </Link>

    <style jsx>{`
      .logo img {
        display: block;
        width: 600px;
        height: 300px;
      }
      @media (max-width: 600px) {
        .logo {
          display: inline-block;
        }
      }
    `}</style>
  </div>
);

export default Logo;
